{"data-component-id":"4k-uUYE7rhaDUCucj_eePHqZ","rel":"stylesheet","href":"{{function run() {
  const { fonts } = props
  if (!fonts?.length) {
    return '#'
  }

  const createFontLink = (fontDetails) => {
    const fontMap = new Map()

    for (let i = 0; i < fontDetails.length; i++) {
      const family = fontDetails[i].family
      const weight = fontDetails[i].weight

      if (fontMap.has(family)) {
        if (!fontMap.get(family).includes(weight)) {
          fontMap.get(family).push(weight)
        }
      } else {
        fontMap.set(family, [weight ?? 400])
      }
    }

    const fontParams = []
    fontMap.forEach((weights, family) => {
      const urlFamily = family.replace(/\s/g, '+')
      // Apparently the weights should be sorted so that it's considered valid. 
      // Otherwise a 400 bad request error is returned
      const urlWeights = weights.map(Number).sort((a, b) => a - b).join(';')
      fontParams.push(`${urlFamily}:wght@${urlWeights}`)
    })

    const href = `https://fonts.googleapis.com/css2?family=${fontParams.join('&family=')}&display=swap`

    return href
  }

  try {
    return createFontLink(fonts)
  } catch (error) {
    console.error(error)
  }
  return '#'
}()
}}"}
